import "./estilos.css";
import React from "react";
import { Link } from "react-router-dom";

export default function LandingPage(){
    return(
        <div className="landing">
            <div className="texto">
            <h1 >Bienvenidos</h1>
            <div>
            <Link to="/home" >
                <button>Home</button>
            </Link>
            </div>
            
            </div>
            
        </div>
    )
        
    
}
